import React from "react";
import {useEffect, useState} from "react";

function App() {

  const [backendData, setBackendData] = useState([{}]);

  useEffect(() => {
    fetch("/api")
      .then((response) => response.json())
      .then((data) => setBackendData(data));
  }, []);

  return (
    <div>
      <h1>Hello World</h1>
      <h2>Backend data:</h2>
      <ul>
        {backendData.users &&
          backendData.users.map((user, index) => <li key={index}>{user}</li>)}
      </ul>
    </div>
  );
}

export default App;
